eventListeners.click:
if (confirm(
  'mouse click stage coords: ' + event.stageX + ',' + event.stageY + '\n'
  + 'Click OK to open a ScatterPlotTool'
))
  weave.requestObject([null],'ScatterPlotTool');

eventListeners.mouseMove:
data && event.buttonDown?{
  x += event.stageX - data.stageX;
  y += event.stageY - data.stageY;
}:{
  data = null
}
